import React from "react";
import CustomBrowserRouter from "./Components/BrowserRouter"; // Używamy naszego komponentu BrowserRouter
import RoutesConfig from "./Components/Route"; // Używamy naszego komponentu RoutesConfig
import "./App.css";

function App() {
  return (
    <CustomBrowserRouter>
      <RoutesConfig />
    </CustomBrowserRouter>
  );
}

export default App;
